def sortList(listToSort):
    # create a copy of the list
    listToSortCopy = listToSort[:]
    # bubble sort
    for i in range(len(listToSortCopy) - 1):
        # loop through all but the last element
        for j in range(0, len(listToSortCopy) - i - 1):
            # if the current element is greater than the next element
            if listToSortCopy[j] > listToSortCopy[j + 1]:
                # swap them
                listToSortCopy[j], listToSortCopy[j + 1] = listToSortCopy[j + 1], listToSortCopy[j]
    # return the sorted list
    return listToSortCopy

