There are many sets that are uncountable. For example, the set of real numbers is uncountable. Here is a proof that uses Cantor's diagonalization to show that the set of all possible one-to-one functions from a set with cardinality $2$ to a set with cardinality $2$ is also uncountable.

Let $S = \{ f: A \to B \}$. Note that $A$ and $B$ have cardinality $2$, so we know that $S$ is a set of cardinality $2^2 = 4$. Consider the following function:

$$f(x) = \begin{cases}
\begin{array}{rl}
    a & \text{if } x = 1, \\
    b & \text{if } x = 2.
\end{array}
\end{cases}$$

For each $f \in S$, we will now define a function $g$ such that $g(f) \neq f$. First, define $g(f) \in S$ by $g(f)(x) = f(3-x)$. For example, if $f = f_1$, then $g(f_1)(x) = f_1(3-x) = f_1(2-x) = b$ for all $x \in A$. It is easy to see that $g(f) \neq f$ for all $f \in S$. This is because if $f_1 \neq f_2$ (i.e., if $f_1(x) \neq f_2(x)$ for some $x \in A$), then $g(f_1) \neq g(f_2)$. To see this, observe that $g(f_1)(x) = f_1(3-x) \neq f_2(3-x) = g(f_2)(x)$.

Since we can construct a function in $S$ that is different from any given function in $S$, we know that there are more than $4$ functions in $S$. Therefore, $S$ is uncountable.
